import base64, os

def get_images_base64():
    '''
    Prints dict with ninja robots images encoded with base64 for 
    updating image_dict in get_ninja_robot() if needed
    '''

    images = {}

    for i in range(0, 11):
        file_name = "{0}.png".format(i)

        current_path, _ = os.path.split(__file__) 
        image_path = os.path.join(current_path, file_name)

        image = open(image_path, 'rb')
        image_read = image.read()
        image_64_encode = base64.encodestring(image_read)

        images[i] = image_64_encode

    print(images)


